import React from 'react';
import { Target, Eye, Zap, Linkedin, Twitter } from 'lucide-react';

const AboutUs = () => {
  // Added a 'quote' and social links for each team member
  const teamMembers = [
    { 
      name: 'Md. Sium', 
      role: 'BUET, CSE', 
      imageUrl: 'https://placehold.co/400x400/6366F1/FFFFFF?text=MS', 
      quote: "The only way to do great work is to love what you do.",
      socials: {
        linkedin: '#',
        twitter: '#',
      }
    },
    { 
      name: 'Atik Khan', 
      role: 'BUET, CSE', 
      imageUrl: 'https://placehold.co/400x400/EC4899/FFFFFF?text=AK', 
      quote: "Success is not final, failure is not fatal: it is the courage to continue that counts.",
      socials: {
        linkedin: '#',
        twitter: '#',
      }
    },
  ];

  const values = [
    { icon: Target, title: 'Our Mission', description: 'To make high-quality education accessible to everyone, everywhere. We empower learners to achieve their career goals and pursue their passions.' },
    { icon: Eye, title: 'Our Vision', description: 'To become the world\'s leading destination for online learning, connecting students with the best instructors and cutting-edge content.' },
    { icon: Zap, title: 'Our Approach', description: 'We focus on practical, hands-on learning. Our courses are designed by industry experts to provide real-world skills that are immediately applicable.' },
  ];

  return (
    <div className="bg-white text-gray-800">
      {/* Hero Section */}
      <div className="relative text-center bg-gray-50 overflow-hidden">
         <div className="container mx-auto px-4 py-24 md:py-32 relative z-10">
            <h1 className="text-4xl md:text-6xl font-extrabold tracking-tight text-gray-900">
                About <span className="text-indigo-600">LearnIT</span>
            </h1>
            <p className="mt-6 text-lg md:text-xl max-w-3xl mx-auto text-gray-600">
                We are dedicated to revolutionizing education by providing accessible, affordable, and effective learning experiences for the next generation of innovators.
            </p>
        </div>
        <div className="absolute top-0 left-0 -translate-x-1/4 -translate-y-1/4 w-96 h-96 bg-indigo-100 rounded-full blur-3xl opacity-50"></div>
        <div className="absolute bottom-0 right-0 translate-x-1/4 translate-y-1/4 w-96 h-96 bg-pink-100 rounded-full blur-3xl opacity-50"></div>
      </div>


      {/* Our Values Section */}
      <section className="py-20 sm:py-28 bg-white">
        <div className="container mx-auto px-4">
          <div className="text-center mb-16">
            <h2 className="text-3xl md:text-4xl font-bold text-gray-900">Our Core Values</h2>
            <p className="mt-3 text-lg text-gray-600 max-w-2xl mx-auto">The principles that drive our commitment to excellence and innovation.</p>
          </div>
          <div className="grid md:grid-cols-3 gap-8">
            {values.map((value, index) => {
              const Icon = value.icon;
              return (
                <div key={index} className="bg-gray-50 border border-gray-200 p-8 rounded-xl transition-all duration-300 hover:shadow-lg hover:-translate-y-1">
                  <div className="flex items-center justify-center bg-indigo-100 h-16 w-16 rounded-full mb-6">
                    <Icon className="h-8 w-8 text-indigo-600" />
                  </div>
                  <h3 className="text-xl font-semibold text-gray-900 mb-3">{value.title}</h3>
                  <p className="text-gray-600 leading-relaxed">{value.description}</p>
                </div>
              );
            })}
          </div>
        </div>
      </section>

      {/* Team Section */}
      <section className="bg-gray-50 py-20 sm:py-28">
        <div className="container mx-auto px-4">
          <div className="text-center mb-16">
            <h2 className="text-3xl md:text-4xl font-bold text-gray-900">Meet Our Team</h2>
            <p className="mt-3 text-lg text-gray-600">The passionate individuals behind LearnIT.</p>
          </div>
          <div className="flex flex-wrap justify-center gap-10 md:gap-12">
            {teamMembers.map((member, index) => (
              <div key={index} className="group w-full max-w-sm text-center">
                <div className="relative">
                    <img
                      className="mx-auto h-48 w-48 rounded-full object-cover shadow-lg transition-all duration-300 group-hover:scale-105"
                      src={member.imageUrl}
                      alt={member.name}
                      onError={(e) => { e.target.onerror = null; e.target.src='https://placehold.co/400x400/CCCCCC/FFFFFF?text=Error'; }}
                    />
                    <div className="absolute bottom-0 right-1/2 translate-x-1/2 translate-y-1/4 flex justify-center space-x-3 w-full">
                        <a href={member.socials.linkedin} className="bg-white shadow-md rounded-full h-10 w-10 flex items-center justify-center text-gray-500 hover:text-indigo-600 transition-colors"><Linkedin size={20}/></a>
                        <a href={member.socials.twitter} className="bg-white shadow-md rounded-full h-10 w-10 flex items-center justify-center text-gray-500 hover:text-indigo-600 transition-colors"><Twitter size={20}/></a>
                    </div>
                </div>
                <div className="mt-8">
                    <h4 className="text-xl font-semibold text-gray-900">{member.name}</h4>
                    <p className="text-indigo-600 font-medium">{member.role}</p>
                    <blockquote className="mt-4 text-gray-600 italic border-l-4 border-indigo-200 pl-4">
                        "{member.quote}"
                    </blockquote>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>
    </div>
  );
};

export default AboutUs;
